BEGIN TRANSACTION;
DROP TABLE IF EXISTS "DailyStatus";
CREATE TABLE IF NOT EXISTS "DailyStatus" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"status"	TEXT,
	"timestamp"	TEXT,
	"comments"	TEXT,
	PRIMARY KEY("year","day","OBJECTID")
);
DROP TABLE IF EXISTS "DailyData";
CREATE TABLE IF NOT EXISTS "DailyData" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"value"	INTEGER,
	"count"	INTEGER,
	PRIMARY KEY("year","day","OBJECTID","value")
);
DROP TABLE IF EXISTS "GeometryTile";
CREATE TABLE IF NOT EXISTS "GeometryTile" (
	"OBJECTID"	INTEGER,
	"tileName"	TEXT
);
DROP TABLE IF EXISTS "WeeklyData";
CREATE TABLE IF NOT EXISTS "WeeklyData" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"value"	INTEGER,
	"count"	INTEGER,
	PRIMARY KEY("year","day","OBJECTID","value")
);
DROP TABLE IF EXISTS "WeeklyStatus";
CREATE TABLE IF NOT EXISTS "WeeklyStatus" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"status"	TEXT,
	"timestamp"	TEXT,
	"comments"	TEXT,
	PRIMARY KEY("year","day","OBJECTID")
);
DROP TABLE IF EXISTS "TileBounds";
CREATE TABLE IF NOT EXISTS "TileBounds" (
	"tile"	TEXT,
	"x_min"	REAL,
	"x_max"	REAL,
	"y_min"	REAL,
	"y_max"	REAL,
	PRIMARY KEY("tile")
);
DROP TABLE IF EXISTS "WaterBodyBounds";
CREATE TABLE IF NOT EXISTS "WaterBodyBounds" (
	"OBJECTID"	INTEGER,
	"x_min"	REAL,
	"x_max"	REAL,
	"y_min"	REAL,
	"y_max"	REAL
);
DROP TABLE IF EXISTS "WaterBodyCounty";
CREATE TABLE IF NOT EXISTS "WaterBodyCounty" (
	"STATEFP"	INTEGER,
	"COUNTYFP"	INTEGER,
	"COUNTYNS"	INTEGER,
	"AFFGEOID"	TEXT,
	"GEOID"	INTEGER,
	"NAME"	TEXT,
	"NAMELSAD"	TEXT,
	"STUSPS"	TEXT,
	"STATE_NAME"	TEXT,
	"LSAD"	INTEGER,
	"ALAND"	REAL,
	"AWATER"	REAL,
	"OBJECTID"	INTEGER
);
DROP TABLE IF EXISTS "WaterBodyState";
CREATE TABLE IF NOT EXISTS "WaterBodyState" (
	"STATEFP"	INTEGER,
	"STATENS"	INTEGER,
	"AFFGEOID"	TEXT,
	"GEOID"	INTEGER,
	"STUSPS"	TEXT,
	"NAME"	TEXT,
	"LSAD"	INTEGER,
	"ALAND"	REAL,
	"AWATER"	REAL,
	"EPAREGION"	INTEGER,
	"OBJECTID"	INTEGER
);
DROP TABLE IF EXISTS "WaterBodyTribe";
CREATE TABLE IF NOT EXISTS "WaterBodyTribe" (
	"AIANNHCE"	INTEGER,
	"AIANNHNS"	INTEGER,
	"AFFGEOID"	TEXT,
	"GEOID"	INTEGER,
	"NAME"	TEXT,
	"NAMELSAD"	TEXT,
	"LSAD"	INTEGER,
	"ALAND"	REAL,
	"AWATER"	INTEGER,
	"OBJECTID"	INTEGER
);
COMMIT;
